import React from "react";
import { Scrollbar, A11y } from "swiper/modules";

import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";
import Navbar from "../../../components/customer/Navbar/Navbar";
import Footer from "../../../components/customer/Footer/Footer";
const index = () => {
  return (
    <div className="home">
      <div className="homeContainer">
        <Swiper
          spaceBetween={50}
          slidesPerView={1}
          onSlideChange={() => console.log("slide change")}
          onSwiper={(swiper) => console.log(swiper)}
          className="h-screen w-screen"
        >
          <SwiperSlide className="text-center h-screen">Slide 1</SwiperSlide>
          <SwiperSlide className="text-center">Slide 2</SwiperSlide>
          <SwiperSlide className="text-center">Slide 3</SwiperSlide>
          <SwiperSlide className="text-center">Slide 4</SwiperSlide>
        </Swiper>
        {/* 
        <div className="h-screen">
           <img
              src="/images/dp.webp"
              alt=""
              className=" h-screen w-screen object-cover"
            />
        </div> */}
      </div>
    </div>
  );
};

export default index;
